contracts/notbitcoin.sol.content:
pragma solidity >= 0.7.0 <0.9.0;

contract notbitcoin {
    string notbitcoin;
    int public Profit;

    constructor(int userInput, string memory _notbitcoin) {
        Profit = userInput;
        notbitcoin = _notbitcoin;

    }

    function viewProfits() public view returns (int){
      return Profit;
  }

    function buy() public {
        Profit += 1;
    }


    function refund() public {

        Profit -= 1;
    }

    // function discount() public returns(int){
    // return Profit = Profit - (Profit * discount);
    // }

}

